import React from 'react';
import {FaGithub, FaTwitter} from 'react-icons/fa'

const Home = () => {
    
  return <>
      <h1>Dillesha Lakshan</h1>
      <p>   frontend web developer</p>
      <ul>
          <li><a href="www.twitter.com"><FaTwitter/></a></li>
          <li><a href="www.github.com"><FaGithub/></a></li>
      </ul>
  </>;
};

export default Home;
